import React, { Component } from 'react';
import { Col, Row } from 'react-bootstrap';
import { connect, RootStateOrAny } from 'react-redux';
//import ConstructorLogo from 'C:\Users\Vitya\constructor-comp-www\public\constructorLogo.png';
import ConstructorLogo from '../../src/constructorLogo.png';

const Header = (props:any) => {

    


    
        return (
            <Row className={'header-body'}>
                <Col>
                    <div className={'header-section'}>
                        <div className={'header-section'}>
                            <img src={ConstructorLogo} className={'header-constructorLogo'} />
                            <div className={'header-item'} onClick={() => window.scrollTo(0,0)}>Start</div>
                            <div className={'header-item'} onClick={() => window.scrollTo(0,props.positionAboutAllComponents[1])} >About our company</div>
                            <div className={'header-item'} onClick={() => window.scrollTo(0,props.positionAboutAllComponents[1])}>Screens about apartment</div>
                            <div className={'header-item'}>Information abaut apartment</div>
                            <div className={'header-item'} onClick={() => window.scrollTo(0,2000)}>Whats outside</div>
                            <div className={'header-item'}>Our professional</div>
                            <div className={'header-item'}>Calculator</div>
                            <div className={'header-item'}>Contact</div>
                        </div>
                        <div className={'header-section2'}>
                            <div className={'header-item'}>Our number: </div>
                            <div className={'header-number'}>+(1)-228-1337-135</div>
                        </div>
                    </div>
                </Col>
            </Row>
        );
    
}






let mapStateToProps = (state: RootStateOrAny) => ({

    positionAboutAllComponents: state.generalInformationAboutTheSite.positionAboutAllComponents

})






export default connect(mapStateToProps, null)(Header);
